Dans le dernier chapitre, nous avons cloné un modèle initial de projet. Nous allons maintenant modifier ce projet. Commençons par enlever l'import de alert et la fonction saluer dans wasm-jeu-de-la-vie/src/lib.rs, et remplacons-les par une définition d'un type pour les cellules : #[wasm_bindgen]
#[repr(u8)]
#[derive(Clone, Copy, Debug, PartialEq, Eq)]
pub enum Cellule { Morte = 0, Vivante = 1,
} Il est important d'avoir #[repr(u8)] pour que chaque cellule soit représentée par un seul octet. Il est aussi important que la variante Morte soit 0 et que la variante Vivante vaut 1, afin que nous puissions facilement compter les voisines vivantes d'une cellule en les additionnant. Ensuite, définissons l'univers. L'univers a une largeur et une hauteur, et a un vecteur de cellules qui a une taille de largeur * hauteur. #[wasm_bindgen]
pub struct Univers { largeur: u32, hauteur: u32, cellules: Vec<Cellule>,
} Pour accéder à la cellule à une ligne et colonne donnée, nous calculons l'emplacement dans le vecteur de cellules avec la ligne et la colonne comme nous l'avons décrit précédemment : impl Univers { fn calculer_indice(&self, ligne: u32, colonne: u32) -> usize { (ligne * self.largeur + colonne) as usize } // ...
} Pour calculer le prochain état d'une cellule, nous devons compter combien de cellules sont vivantes dans son voisinage. Ecrivons donc une méthode compter_voisines_vivantes pour cela ! impl Universe { // ... fn compter_voisines_vivantes(&self, ligne: u32, colonne: u32) -> u8 { let mut compteur = 0; for delta_ligne in [self.hauteur - 1, 0, 1].iter().cloned() { for delta_colonne in [self.largeur - 1, 0, 1].iter().cloned() { if delta_ligne == 0 && delta_colonne == 0 { continue; } let ligne_voisine = (ligne + delta_ligne) % self.hauteur; let colonne_voisine = (colonne + delta_colonne) % self.largeur; let indice = self.calculer_indice(ligne_voisine, colonne_voisine); compteur += self.cellules[indice] as u8; } } compteur }
} La méthode compter_voisines_vivantes utilise les deltas et les modulos pour éviter de traiter les cas particuliers des bords de l'univers avec le if. Lorsqu'on applique un delta de -1, nous ajoutons self.hauteur - 1 et nous laissons le modulo faire son travail, plutôt que d'essayer d'enlever 1. ligne ou colonne peut valoir 0, et si nous essayons de leur soustraire 1, nous serons alors en dehors des valeurs acceptées par les entiers non-signés. Maintenant, nous avons tout ce dont nous avons besoin pour calculer la prochaine génération ! Chaque règle du jeu suit des transformations simples suivant des conditions qui peuvent tenir dans une expression match. De plus, comme nous souhaitons que le JavaScript contrôle lorsque les ticks se produisent, nous allons intégrer cette méthode dans un bloc #[wasm_bindgen], pour qu'il soit exposé au JavaScript. /// Méthodes publiques, exportées en JavaScript.
#[wasm_bindgen]
impl Univers { pub fn tick(&mut self) { let mut generation_suivante = self.cellules.clone(); for ligne in 0..self.hauteur { for colonne in 0..self.largeur { let indice = self.calculer_indice(ligne, colonne); let cellule = self.cellules[indice]; let voisines_vivantes = self.compter_voisines_vivantes(ligne, colonne); let prochain_etat = match (cellule, voisines_vivantes) { // Règle 1 : toute cellule vivante avec moins de deux // voisines vivantes meurt, comme si cela était un effet de // sous-population. (Cellule::Vivante, x) if x < 2 => Cellule::Morte, // Règle 2 : toute cellule vivante avec deux ou trois // voisines vivantes survit jusqu'à la prochaine génération. (Cellule::Vivante, 2) | (Cellule::Vivante, 3) => Cellule::Vivante, // Règle 3 : toute cellule vivante avec plus de trois // voisines vivantes meurt, comme si cela était un effet de // surpopulation. (Cellule::Vivante, x) if x > 3 => Cellule::Morte, // Règle 4 : toute cellule morte avec exactement trois // voisines vivantes devient une cellule vivante, comme si // cela était un effet de reproduction. (Cellule::Morte, 3) => Cellule::Vivante, // Les cellules qui ne répondent à aucune de ces conditions // restent dans le même état. (statut, _) => statut, }; generation_suivante[idx] = prochain_etat; } } self.cellules = generation_suivante; } // ...
} Pour l'instant, l'état de l'univers est modélisé par un vecteur de cellules. Pour rendre cela lisible pour un humain, implémentons un rendu textuel basique. L'idée est d'écrire l'univers ligne par ligne textuellement, ainsi nous allons écrire le caractère Unicode ◼ (le "carré moyen noir") pour chaque cellule vivante. Et pour les cellules mortes, nous allons écrire ◻ (le "carré moyen blanc"). En implémentant le trait Display de la bibliothèque standard de Rust, nous pouvons ajouter un moyen de formater la structure de manière à ce qu'elle soit adaptée pour l'utilisateur. Cela va aussi nous fournir automatiquement une méthode to_string . use std::fmt; impl fmt::Display for Univers { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { for ligne in self.cellules.as_slice().chunks(self.largeur as usize) { for &cellules in ligne { let symbole = if cellule == Cellule::Morte { '◻' } else { '◼' }; write!(f, "{}", symbole)?; } write!(f, "\n")?; } Ok(()) }
} Enfin, nous définissons un constructeur qui initialise l'univers avec un schéma intéressant avec des cellules vivantes et mortes, ainsi qu'une méthode rendu : /// Méthodes publiques, exportées en JavaScript.
#[wasm_bindgen]
impl Univers { // ... pub fn new() -> Univers { let largeur = 64; let hauteur = 64; let cellules = (0..largeur * hauteur) .map(|i| { if i % 2 == 0 || i % 7 == 0 { Cellule::Vivante } else { Cellule::Morte } }) .collect(); Univers { largeur, hauteur, cellules, } } pub fn rendu(&self) -> String { self.to_string() }
} Avec tout cela, la partie Rust de notre jeu de la vie est complète ! Recompilez-la en WebAssembly en lançant wasm-pack build dans le dossier wasm-jeu-de-la-vie.

